PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE users(
                id INT,
                username TEXT,
                score_format TEXT,
                generation INT
            );
CREATE TABLE favourites(
                user_id INT,
                item_id INT,
                name TEXT,
                type TEXT,
                cover_image_url TEXT
            );
CREATE TABLE media_details(
                media_id INT,
                title TEXT,
                season TEXT,
                season_year INT,
                episodes INT,
                media_type TEXT,
                format TEXT,
                genres TEXT,
                cover_image_url_xl TEXT,
                cover_image_url_lg TEXT,
                cover_image_url_md TEXT,
                banner_image_url TEXT,
                average_score REAL,
                mean_score REAL,
                source TEXT,
                studios TEXT,
                is_sequel BOOLEAN
            );
CREATE TABLE media_tags(
                tag_id INT,
                name TEXT,
                category TEXT
            );
CREATE TABLE media_tags_bridge(
                media_id INT,
                tag_id INT,
                rank INT
            );
CREATE TABLE score_mapping(
  user_id INT,
  username TEXT,
  score,
  anichan_score INT
);
CREATE TABLE IF NOT EXISTS "raw_lists"(
			user_id INT,
			username TEXT,
			score TEXT,
			anichan_score TEXT,
			status TEXT,
			media_id INTEGER,
			media_type TEXT,
			title TEXT,
            progress INTEGER,
            completed_at TEXT,
			retrieved_date TEXT,
			next_date TEXT
);
CREATE TABLE stg_lists(
  user_id INT,
  username TEXT,
  score_format TEXT,
  generation INT,
  score,
  anichan_score INT,
  appropriate_score INT,
  status TEXT,
  media_id INT,
  media_type TEXT,
  title TEXT,
  progress INT,
  completed_at TEXT,
  retrieved_date TEXT,
  next_date TEXT
);
COMMIT;
